import React from 'react';
import { Container, Box, Typography, Link } from '@mui/material';

const LandingPage = () => {
  return (
    <div>
      <Container maxWidth="lg">
        {/* Full-height section with text */}
        <Box
          style={{
            minHeight: '100vh',
            display: 'flex',
            alignItems: 'center',
            justifyContent: 'flex-start',
          }}
        >
          <Typography variant="h4" style={{ marginLeft: '25%' }}>
            Welcome to My Portfolio
            <br />
            <Typography variant="body1" color="textSecondary">
              Hello, I'm a passionate software engineer dedicated to building innovative and efficient solutions. My expertise includes front-end development, user experience design, and leveraging the latest technologies to create seamless and dynamic user interfaces.
            </Typography>
          </Typography>
        </Box>

        {/* Your existing content */}
        <Box textAlign="center" my={4}>
          <Typography variant="h6">Interested in my work?</Typography>
          <Link href="/projects" color="primary">
            View My Projects
          </Link>
        </Box>
      </Container>
    </div>
  );
};

export default LandingPage;
